import React from "react";
import "./Product.css";

const Product = () => {
  const cards = Array.from({ length: 8 }, () => (
    <div className="card">
      <div className="imgBx">
        <img src="https://assets.codepen.io/4164355/shoes.png" alt="Nike Shoes" />
      </div>
      <div className="contentBx">
        <h2>Nike Shoes</h2>
        <div className="size">
          <h3>Size :</h3>
          <span>7</span>
          <span>8</span>
          <span>9</span>
          <span>10</span>
        </div>
        <div className="color">
          <h3>Color :</h3>
          <span />
          <span />
          <span />
        </div>
        <a href="#">Buy Now</a>
      </div>
    </div>
  ));

  return (
    <div className="product_container">
      <h1 className="product_title">Our Best Gifts</h1>
      {cards}
    </div>
  );
};

export default Product;
